(anglican.infcomp.core/reset-infcomp-addressing-scheme!)

(with-primitive-procedures [ m/mmul m/identity-matrix m/add ]
  (defquery gp-hyperparameters [ xs ys ]
    (let [
          cov (fn [k xs]
                (map (fn [i] (map #(k i %) xs)) xs))
           
          sigma2 0.01
          
          belief (normal 0 1)
          positive-belief (gamma 1 1)

         ;; kernel function parameters
          amplitude (sample positive-belief)
          lengthscale (sample positive-belief)
          
          ;; the mean function: 0 here
          m (fn [x] 0)

         ;; the kernel function: d·exp(-(x-y)²/2e)
          k (fn [x y]
              (let [dx (- x y)]
                (* amplitude (exp (- (/ (* dx dx) 2. lengthscale))))))
          
          ms (map m xs)
          ks (cov k xs)]
      
      (observe (mvn ms (add ks (mmul (identity-matrix (count xs)) sigma2))) ys)
      
      {:amplitude amplitude, :lengthscale lengthscale})))
