(defn generate-data [ xs d e ]
  (let [cov (fn [k xs]
                (map (fn [i] (map #(k i %) xs)) xs))
        sigma2 0.01
        m (fn [x] 0)
        k (fn [x y]
            (let [dx (- x y)]
              (* d (exp (- (/ (* dx dx) 2. e))))))
        ms (map m xs)
        ks (cov k xs)]
    
    (sample* (mvn ms (m/add ks (m/mmul (m/identity-matrix (count xs)) sigma2))))))

