;; @@
(defn runCSIS [ particles ] 

(let [ x (linspace -10 10 100)
       y generated-data ]
  (loop [data [] reps particles samples (infer :csis gp-hyperparameters [ x y ])]
    (if (> reps 0)
      (do (println (clojure.string/join "," [ (:lengthscale (:result (first samples))) (:amplitude (:result (first samples))) (:log-weight (first samples)) ]))
        (recur (conj data (clojure.string/join "," [ (:lengthscale (:result (first samples))) (:amplitude (:result (first samples))) (:log-weight (first samples)) ])) (dec reps) (rest samples)))
      (spit (clojure.string/join "" ["/homes/70/willh/Programs/gp-hyperparameters/data2/infcomp_" (str particles) "_1d_2.csv"]) (clojure.string/join "\n" data))))
  ))

(map runCSIS num-particles)
